description:
Данная ручка притягивает к себе внимание за счет использования в отделке классических цветов и в то же время современным дизайном. Владелец такой ручки оценит все ее достоинства.

Отделка: 
- классическая и элегантная с черным лаковым покрытием;
- корпус украшен классическим мотивом Parker, широкий металлический обод на колпачке;
- длина: 162,7мм;
- ширина: 16,71мм.

Детали дизайна:
- хромированные.

Наконечник Parker 5TH
- интенсивные черные и синие чернила - технология Parker 5TH ;
- состоит из гибкого наконечника, взаимодействующего с украшенной выгравированной стрелой Parker металлическим пером;
- гарантирует ни с чем не сравнимое ощущение мягкости и скольжения при письме, яркий и четкий штрих;
- с первых слов приспосабливается к любому почерку;
- использует ультрасовременную технологию.

Очки виртуальной реальности Reality – довольно простое устройство, которое с помощью смартфона может перенести любого, кто их наденет, в мир будущего. Эта технология позволяет пользователю очутиться в виртуальном окружении и смотреть видео или игровой контент глазами непосредственного участника виртуальных событий. 
Устройства и приложения, работающие с виртуальной реальностью, пользуются огромной популярностью, поэтому такие очки станут отличным подарком для любителей гаджетов. Принцип работы таких очков очень прост: смартфон, на который загружены VR-приложения или игры (например, Roller Coaster, VR Video Player или любые другие), вставляется в специальную нишу, очки надеваются на голову, и вы переноситесь в виртуальную реальность. 

Что важно знать про очки виртуальной реальности Reality: 
∙ очки работают только со смартфоном; 
∙ они подходят для смартфонов с диагональю 3,5-6 дюймов; 
∙ качество изображения зависит от экрана смартфона; 
∙ в этих очках можно смотреть 3D-фильмы.

Стильная термоизолирующая бутылка Актив объемом 500 мл может выполнять одну из функций: сохранять напитки горячими в течение 24 часов или охлажденными. Эргономичный корпус выполнен из нержавеющей стали. Бутылку удобно держать в руках, а также хранить в рюкзаке или портфеле. Она выполнена в трех цветовых вариациях: глянцевый синий и красный, а также монохромный стальной. Термоизолирующая бутылка - универсальный и полезный подарок - взяв ее один раз в руки, вы не захотите с ней расставаться!
 
Ключевые преимущества:
 
Корпус бутылки изготовлен из нержавеющей стали 18/8 с двойными стенками и вакуумной изоляцией. В изделии используются только нетоксичные материалы, в результате чего у напитка отсутствует металлический привкус;
Термоизолирующая бутылка - идеальный подарок для людей, ведущих активный образ жизни. Подходит для отдыха на природе, занятий в тренажерном зале, пеших прогулок. Также, бутылка Актив” займет достойное место в офисе или дома. Эргономичный дизайн корпуса легко сочетается со всеми автомобильными держателями;
Бутылку Актив” нельзя использовать для замораживания, а также в микроволновой печи и посудомоечных машинах.

