Отличный продуктовый набор для ценителя чая и чайной церемонии в офисе или дома. В наборе есть все для этого необходимое:

· Индийский крупнолистовой чай;

· Чай Урожайный год;

· Чай Порох крупный;

· Кружка Марго.

Прекрасный набор из черного, зеленого и фруктового чая придется по вкусу даже самым требовательным клиентам, а кружка Марго с вашим логотипом или промо информацией будет напоминать об успешном сотрудничестве. Набор упакован в крафтовую картонную коробку, которую также можно персонализировать.

